import React, { useState } from 'react';
import './App.css';
import Input from './components/Input';
import Card from './components/Card';

// Função para gerar uma cor aleatória
const generateRandomColor = () => {
  const letters = '0123456789ABCDEF';
  let color = '#';
  for (let i = 0; i < 6; i++) {
    color += letters[Math.floor(Math.random() * 16)];
  }
  return color;
};

const App = () => {
  const [people, setPeople] = useState([]);
  const [showForm, setShowForm] = useState(false);
  const [showList, setShowList] = useState(false);
  const [formData, setFormData] = useState({ name: '', email: '', birthdate: '', id: null });
  const [errors, setErrors] = useState({});
  const [successMessage, setSuccessMessage] = useState('');

  const validateForm = () => {
    let formErrors = {};
    const { name, email, birthdate } = formData;

    if (!name) formErrors.name = 'Nome é obrigatório!';
    if (!email || !/\S+@\S+\.\S+/.test(email)) formErrors.email = 'E-mail inválido!';
    if (!birthdate) formErrors.birthdate = 'Data de nascimento é obrigatória!';

    return formErrors;
  };

  const handleSubmit = (e) => {
    e.preventDefault();

    const validationErrors = validateForm();

    if (Object.keys(validationErrors).length === 0) {
      if (formData.id) {
        const updatedPeople = people.map((person) =>
          person.id === formData.id ? { ...formData } : person
        );
        setPeople(updatedPeople);
        setShowList(true);
        setShowForm(false);
      } else {
        setPeople([...people, { ...formData, id: Date.now(), color: generateRandomColor() }]);
        setSuccessMessage('Pessoa cadastrada com sucesso!');
        setTimeout(() => setSuccessMessage(''), 3000);
        setFormData({ name: '', email: '', birthdate: '', id: null });
        setShowList(true);
        setShowForm(false);
      }
    } else {
      setErrors(validationErrors);
    }
  };

  return (
    <div className="App">
      <div className="header-container">
        <h1 className="animated-title">Desafio de Front-End</h1>
        <h2 className="animated-subtitle">CRUD de Pessoas</h2>
      </div>

      <div className="buttons-container">
        <button className="create-btn" onClick={() => setShowForm(true)} disabled={showForm}>
          Criar Nova Pessoa
        </button>
        <button className="list-btn" onClick={() => setShowList(!showList)} disabled={people.length === 0}>
          {showList ? 'Ocultar Lista' : 'Exibir Lista'}
        </button>
      </div>

      {successMessage && <div className="success-message">{successMessage}</div>}

      {showForm && (
        <form onSubmit={handleSubmit} className="form-container">
          <Input
            type="text"
            label="Nome"
            name="name"
            value={formData.name}
            onChange={(e) => setFormData({ ...formData, name: e.target.value })}
            error={errors.name}
          />
          <Input
            type="email"
            label="E-mail"
            name="email"
            value={formData.email}
            onChange={(e) => setFormData({ ...formData, email: e.target.value })}
            error={errors.email}
          />
          <Input
            type="date"
            label="Data de Nascimento"
            name="birthdate"
            value={formData.birthdate}
            onChange={(e) => setFormData({ ...formData, birthdate: e.target.value })}
            error={errors.birthdate}
          />
          <button type="submit" className="submit-btn">
            {formData.id ? 'Atualizar' : 'Cadastrar'}
          </button>
        </form>
      )}

      {showList && (
        <div className="list-container">
          <h2>Lista de Pessoas</h2>
          <div className="cards-wrapper">
            {people.map((person) => (
              <Card key={person.id} person={person} onEdit={setFormData} />
            ))}
          </div>
        </div>
      )}
    </div>
  );
};

export default App;
